import React, { useState, useEffect } from "react";
import { Box, Typography, Button, Grid, Paper, List, ListItem, ListItemText, CircularProgress } from "@mui/material";
import { useNavigate, useLocation } from "react-router-dom";

const ConfirmationPage = () => {
  const [bookingDetails, setBookingDetails] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const navigate = useNavigate();
  const location = useLocation(); // Access location passed via navigate()

  useEffect(() => {
    if (location.state && location.state.bookingDetails) {
      setBookingDetails(location.state.bookingDetails);
    } else {
      setError("No booking details found.");
    }
  }, [location.state]);

  const calculateTotalPrice = () => {
    const { food, court, gym } = bookingDetails;
    let price = 0;

    // Price logic based on food bundle and meal type
    const customPeriod = parseInt(food.customPeriod, 10);
    if (food.bundle === "monthly" && food.mealType === "breakfast-lunch-dinner") price = 5100;
    if (food.bundle === "22-days" && food.mealType === "breakfast-lunch-dinner") price = 3740;
    if (food.bundle === "monthly" && food.mealType === "lunch") price = 3000;
    if (food.bundle === "22-days" && food.mealType === "lunch") price = 3000;
    if (food.bundle.includes("Custom") && food.mealType === "breakfast-lunch-dinner" && customPeriod)
      price = customPeriod * 170;
    if (food.bundle.includes("Custom") && food.mealType === "lunch" && customPeriod) price = customPeriod * 100;

    // Additional prices for court and gym
    if (court && gym) {
      price += 500; // Example additional cost for services
    }

    return price;
  };

  if (loading) {
    return (
      <Box sx={{ display: "flex", justifyContent: "center", alignItems: "center", minHeight: "100vh" }}>
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Box sx={{ textAlign: "center", marginTop: 3 }}>
        <Typography variant="h6" color="error">
          {error}
        </Typography>
      </Box>
    );
  }

  if (!bookingDetails) {
    return (
      <Box sx={{ textAlign: "center", marginTop: 3 }}>
        <Typography variant="h6">No booking found.</Typography>
      </Box>
    );
  }

  return (
    <Box
      sx={{
        minHeight: "100vh",
        backgroundImage: "url('./background2.jpg')", // Path to your image in the public folder
        backgroundSize: "cover",
        backgroundPosition: "center",
        backgroundRepeat: "no-repeat",
        padding: 4,
      }}
    >
      <Grid container spacing={2}>
        <Grid item xs={12}>
          <Paper sx={{ padding: 4 }}>
            <Typography variant="h5" gutterBottom>
              Booking Confirmation
            </Typography>

            <Typography variant="h6" gutterBottom>
              Food Bundle: {bookingDetails.food.bundle} ({bookingDetails.food.mealType})
            </Typography>

            {bookingDetails.food.bundle === "custom" && bookingDetails.food.customPeriod && (
              <Typography variant="body1">Custom Period: {bookingDetails.food.customPeriod} days</Typography>
            )}

            <Typography variant="h6" gutterBottom>
              Court Booking: {bookingDetails.court.type} - {bookingDetails.court.time} on{" "}
              {bookingDetails.court.date?.format("DD/MM/YYYY")}
            </Typography>

            <Typography variant="h6" gutterBottom>
              Gym Time: {bookingDetails.gym.time} on {bookingDetails.gym.date?.format("DD/MM/YYYY")}
            </Typography>

            <Typography variant="h6" gutterBottom>
              Total Price: {calculateTotalPrice()} EGP
            </Typography>

            <Button variant="contained" color="primary" onClick={() => navigate("/")}>
              Go to Homepage
            </Button>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default ConfirmationPage;
